async () => {
  let DataSoftware = appsmith.store.Authorize_Data_API_Software_NTBX || [];
  if (DataSoftware?.length > 0) {
    DataSoftware = [];
  }
  await API_GET_Software_NTBX.run();
  await storeValue('Data_API_Software_NTBX', API_GET_Software_NTBX.data);
  await storeValue('Authorize_Data_API_Software_NTBX', undefined);
  for (let i = 0; i < API_GET_Software_NTBX.data.length; i++) {
    if (API_GET_Software_NTBX.data[i].version_id === 1) {
      DataSoftware?.push(API_GET_Software_NTBX.data[i]);
      storeValue('Authorize_Data_API_Software_NTBX', _.unionBy(DataSoftware));
    } else {
      console.log('not found!!');
    }
  }
}
